###########################################
## WINDOWS 10 UPGRADE TOAST NOTIFICATION ##
###########################################

<#
Function Convert-Base64toFile {
    Param($Base64Sting,$OutputFileName)
    $File = "C:\Users\tjones\OneDrive\Pictures\H_toast.png"
    $Image = [System.Drawing.Image]::FromFile($File)
    $MemoryStream = New-Object System.IO.MemoryStream
    $Image.Save($MemoryStream, $Image.RawFormat)
    [System.Byte[]]$Bytes = $MemoryStream.ToArray()
    $Base64 = [System.Convert]::ToBase64String($Bytes)
    $Image.Dispose()
    $MemoryStream.Dispose()
    $Base64 | out-file "C:\Users\tjones\OneDrive\Pictures\H_toast.txt"
}
#>

# Create a custom protocol
$RootFolder = $env:ProgramData
$ParentFolderName = "IT"
$ChildFolderName = "1909_Upgrade"
$WorkingDirectory = "$RootFolder\$ParentFolderName\$ChildFolderName"
$RegPath = "HKCU:\Software\Classes\start1909upgrade\"
$null = New-Item -Path "$RegPath" -Force
$null = New-ItemProperty -Path "$RegPath" -Name "(Default)" -Value "URL:start1909upgrade" -PropertyType "String"
$null = New-ItemProperty -Path "$RegPath" -Name "URL Protocol" -Value "" -PropertyType "String"
$null = New-Item -Path "$RegPath\shell\open\command" -Force
$null = New-ItemProperty -Path "$RegPath\shell\open\command" -Name "(Default)" -Value "$WorkingDirectory\start1909upgrade.cmd" -PropertyType "String"

# Set working registry location
$RootRegBase = "HKLM:\Software"
$RootRegBranchName = "IT"
$UpgradeBranchName = "1909Upgrade"
$FullRegPath = "$RootRegBase\$RootRegBranchName\$UpgradeBranchName"

######################
## OS Version Check ##
######################
# Before going any further, check that the OS has not already been upgraded
$Version = (Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\Windows NT\CurrentVersion' -Name ReleaseID -ErrorAction Stop).ReleaseID
#Set-ItemProperty -Path $FullRegPath -Name OSVersion -Value $Version -Force
If ($Version -ge "1909")
{
    Return
}

# Figure out who's logged on if possible
$GivenName = Get-ItemProperty -Path HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Authentication\LogonUI -Name LastLoggedOnDisplayName -ErrorAction SilentlyContinue | Select -ExpandProperty LastLoggedOnDisplayName -ErrorAction SilentlyContinue
If ($GivenName)
{
    $Name = $GivenName.Split(',')[1].Trim().Split()[0]
}
Else
{
    $Name = "there"
}

# Check if we're running the same day the PreDownload finished, so we can allow the scheduled task to be triggered any time of day.
$PreDownloadFinishDate = Get-Date (Get-ItemProperty -Path HKLM:\SOFTWARE\IT\1909Upgrade -Name PreDownloadStartTime | Select -ExpandProperty PreDownloadStartTime)
$SameDay = $PreDownloadFinishDate.Date -eq (Get-Date).Date

# Get Deadline
$Deadline = Get-ItemProperty -Path $FullRegPath -Name Deadline -ErrorAction SilentlyContinue | Select -ExpandProperty Deadline -ErrorAction SilentlyContinue
# Less than 7 days to go, notifications twice daily, else once daily
If (([Datetime]::Now - (Get-Date $Deadline)).TotalDays -lt -7 -and $SameDay -ne $True)
{
    # If afternoon, skip the notification
    If ([Datetime]::Now.TimeofDay.TotalHours -gt 12)
    {
        Return
    }
}
If (([Datetime]::Now - (Get-Date $Deadline)).TotalMinutes -gt 0)
{
    $DeadlinePassed = $true
}

# Notification parameters
If ($DeadlinePassed -eq $true)
{
    $Title = "Hi $Name, your PC is running an outdated version of Windows without the latest security features."
    $AudioSource = "ms-winsoundevent:Notification.Looping.Alarm9"
    $SubtitleText2 = "To ensure your computer is protected, you need to upgrade to Windows 10 1909. Click 'Install now' to begin the upgrade. It typically takes 30-40 minutes and will require a restart of your PC."
    $SubtitleText3 = "Until you have completed the update, this notification will be here as a reminder for you."
    $Base64Image = ""
}
ElseIf ($DeadlinePassed -eq $true -and $ExcludedDevice -eq $true)
{
    $Title = "Hey $Name, we've got an update for you"
    $AudioSource = "ms-winsoundevent:Notification.Default"
    $SubtitleText = "Windows is a service and updates are a normal part of keeping it running smoothly. We need your help installing this one."
    $SubtitleText2 = "The deadline for updating has passed!"
    $SubtitleText3 = "Update as soon as possible using the 'Windows 10 Update' shortcut on your desktop."
}
else 
{
    $Title = "Hey $Name, we've got an update for you"
    $AudioSource = "ms-winsoundevent:Notification.Default"
    $SubtitleText = "Windows is a service and updates are a normal part of keeping it running smoothly. We need your help installing this one."
    $SubtitleText2 = "Update at any time using the 'Windows 10 Update' shortcut on your desktop."
    $SubtitleText3 = "You must update before $Deadline"
    $Base64Image = ""
}

# Create the image and logo files from base64
$Base64Logo = "mybase64logo"
$LogoFile = "$env:TEMP\ToastLogo.png"
[byte[]]$Bytes = [convert]::FromBase64String($Base64Logo)
[System.IO.File]::WriteAllBytes($LogoFile,$Bytes)
$ImageFile = "$env:TEMP\ToastImage.png"
[byte[]]$Bytes = [convert]::FromBase64String($Base64Image)
[System.IO.File]::WriteAllBytes($ImageFile,$Bytes)

# Load some required namespaces
$null = [Windows.UI.Notifications.ToastNotificationManager, Windows.UI.Notifications, ContentType = WindowsRuntime]
$null = [Windows.Data.Xml.Dom.XmlDocument, Windows.Data.Xml.Dom.XmlDocument, ContentType = WindowsRuntime]

# Register the AppID in the registry for use with the Action Center, if required
$AppID = "contoso.com"
$RegPath = 'HKCU:\SOFTWARE\Microsoft\Windows\CurrentVersion\Notifications\Settings'
if (!(Test-Path -Path "$RegPath\$AppId")) {
    $null = New-Item -Path "$RegPath\$AppId" -Force
    $null = New-ItemProperty -Path "$RegPath\$AppId" -Name 'ShowInActionCenter' -Value 1 -PropertyType 'DWORD'
}

# Define the toast notification in XML format
If ($DeadlinePassed -eq $true -and $ExcludedDevice -ne $true)
{
[xml]$ToastTemplate = @"
<toast scenario="reminder">
    <visual>
    <binding template="ToastGeneric">
        <text>Required Windows 10 Upgrade</text> 
        <image placement="hero" src="$ImageFile"/>
        <image id="1" placement="appLogoOverride" hint-crop="circle" src="$LogoFile"/>
        <group>
            <subgroup>
                <text hint-style="title" hint-wrap="true" >$Title</text>
            </subgroup>
        </group>
        <group>          
            <subgroup>     
                <text hint-style="subtitle" hint-wrap="true" >$SubtitleText2</text>
            </subgroup>
        </group>
        <group>          
            <subgroup>     
                <text hint-style="subtitle" hint-wrap="true" >$SubtitleText3</text>
            </subgroup>
        </group>
    </binding>
    </visual>
    <actions>
        <action content="Install now" activationType="protocol" arguments="start1909upgrade:" />
    </actions>
    <audio src="$AudioSource" loop="false"/>
</toast>
"@
}
Else
{
[xml]$ToastTemplate = @"
<toast duration="long">
    <visual>
    <binding template="ToastGeneric">
        <text>Windows 10 1909</text> 
        <image placement="hero" src="$ImageFile"/>
        <image id="1" placement="appLogoOverride" hint-crop="circle" src="$LogoFile"/>
        <group>
            <subgroup>
                <text hint-style="title" hint-wrap="true" >$Title</text>
            </subgroup>
        </group>
        <group>          
            <subgroup>     
                <text hint-style="subtitle" hint-wrap="true" >$SubtitleText</text>
            </subgroup>
        </group>
        <group>          
            <subgroup>     
                <text hint-style="subtitle" hint-wrap="true" >$SubtitleText2</text>
            </subgroup>
        </group>
        <group>          
            <subgroup>     
                <text hint-style="subtitle" hint-wrap="true" >$SubtitleText3</text>
            </subgroup>
        </group>
    </binding>
    </visual>
    <audio src="$AudioSource"/>
</toast>
"@  
}

# Load the notification into the required format
$ToastXml = New-Object -TypeName Windows.Data.Xml.Dom.XmlDocument
$ToastXml.LoadXml($ToastTemplate.OuterXml)

# Display
$App = "contoso.com"
[Windows.UI.Notifications.ToastNotificationManager]::CreateToastNotifier($app).Show($ToastXml)